import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navitage } from 'react-router-dom';

function Home() {
  return <h2>Home Page</h2>;
}

function Login() {
  return <h2>Please Log In</h2>;
}

function Dashboard() {
  const isLoggedIn = false; // Example login status

  if (!isLoggedIn) {
    return <Navigate to="/login" />;
  }

  return <h2>Dashboard</h2>;
}

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route exact path="/" component={Home} />
          <Route path="/login" component={Login} />
          <Route path="/dashboard" component={Dashboard} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
